import { Link } from "react-router-dom";
import "./index.css"


function SidBar(){
    return(
        <div className="sidbar">
        <ul className="list-unstyled p-4  ">
        <li className="mb-4 "><Link className="text-decoration-none" to={"/Prodact"}>Get All Prodact</Link></li>
        <li><Link className="text-decoration-none" to={"/Catgress"}>Get All Categress</Link></li>

        </ul>
        </div>
    )
}
export default SidBar
